import React from 'react';
import Footer from './Footer';
import './Calc.scss';

const Calc = ({ children }) => {
    return (
        <main>
            <div className="switches">
                <div className="darkmode">
                    <ReactSwitch />
                </div>

                <div className="retromode">
                    <ReactSwitch />
                </div>
            </div>
            <div className="calculator">
                { children }
            </div>
            <Footer />
        </main>
    );
}

export default Calc;
